import {Formik, Form, Field} from 'formik';
import './header.css';

const App = () => {
  return (
    <div>
      <header>
        <Formik
          initialValues={{search: '',}}
          onSubmit={async values => {
            const response = await fetch(`https://api.unsplash.com/search/photos?per_page=20&query=${values.search}`)

          }}
        >
        <Form>
          <Field name='search' />
        </Form>
        </Formik>
      </header>
    </div>
  );
}

export default App;
